import React from 'react';
import './App.css'; // Import your CSS file

function App() {
  return (
    <div className="App">
      {/* Header component */}
      <header className="site-navbar site-navbar-target">
        {/* Header content */}
      </header>

      {/* Main content */}
      <main>
        {/* Home component */}
        <div id="Home" className="tabcontent">
          {/* Home content */}
        </div>

        {/* About component */}
        <div id="About" className="tabcontent">
          {/* About content */}
        </div>

        {/* Music component */}
        <div id="Music" className="tabcontent">
          {/* Music content */}
        </div>

        {/* Contact component */}
        <div id="Contact" className="tabcontent">
          {/* Contact content */}
        </div>
      </main>

      {/* Footer component */}
      <footer>
        {/* Footer content */}
      </footer>
    </div>
  );
}

export default App;
